INSERT INTO `blogs` (`id`, `title`, `user_id`, `category_id`, `description`, `image`, `is_featured`, `is_active`, `created_at`) VALUES
(1, '¿Qué hace un cirujano bucomaxilofacial?', 1, 1, '<p>De acuerdo con la <a href=\"http://alacibu.org/\">Asociaci&oacute;n Latinoamericana de Cirug&iacute;a Bucomaxilofacial, Alacibu, </a>la Cirug&iacute;a Bucomaxilofacial &ldquo;es aquella especialidad de la odontolog&iacute;a que se ocupa de la prevenci&oacute;n, diagn&oacute;stico y tratamiento de las enfermedades, traumatismos y defectos funcionales o est&eacute;ticos, cong&eacute;nitos o adquiridos, de los tejidos duros y blandos de la regi&oacute;n bucal y maxilofacial, as&iacute; como de los tejidos y &oacute;rganos relacionados que la limitan e integran.&rdquo;</p>\n\n<p>&nbsp;</p>\n\n<p>En Venezuela solamente puede utilizar el t&iacute;tulo de &ldquo;Cirujano Bucal&rdquo; o &ldquo;Cirujano Bucomaxilofacial&rdquo; aquel Odont&oacute;logo que ha culminado a cabalidad un curso de postgrado en Cirug&iacute;a Bucal de no menos de dos a&ntilde;os de duraci&oacute;n, o de Cirug&iacute;a Bucomaxilofacial de no menos de tres a&ntilde;os de duraci&oacute;n, en una instituci&oacute;n universitaria u hospitalaria reconocida por el Ministerio del Poder Popular para la Salud y el Ministerio del Poder Popular para la Educaci&oacute;n y validada dicha especialidad por el <a href=\"http://www.elcov.org/\">Colegio de Odont&oacute;logos de Venezuela.</a></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>Los campos de actuaci&oacute;n, del cual se desprenden &aacute;reas de formaci&oacute;n acad&eacute;mica e investigaci&oacute;n cient&iacute;fica, incluyen entre otros: anomal&iacute;as y patolog&iacute;as de las estructuras buco-maxilofaciales, cirug&iacute;a de labio y paladar hendido; implantes endo&oacute;seos, transplantes y reimplantes en la regi&oacute;n buco-maxilofacial, injertos y cirug&iacute;a reconstructiva de los tejidos duros y blandos en la regi&oacute;n bucomaxilofacial, distracci&oacute;n osteog&eacute;nica; cirug&iacute;a dentoalveolar; tratamiento de trauma de los tejidos duros y blandos de la regi&oacute;n maxilofacial; cirug&iacute;a ortogn&aacute;tica, preprot&eacute;sica y ortop&eacute;dica facial, cirug&iacute;a con finalidades ortod&oacute;nticas y anomal&iacute;as dentofaciales, biopsias de la regi&oacute;n bucomaxilofacial, tratamiento conservador y quir&uacute;rgico de los trastornos de la articulaci&oacute;n temporomandibular, diagn&oacute;stico y tratamiento quir&uacute;rgico y no quir&uacute;rgico de los quistes, tumores y enfermedades de la regi&oacute;n bucomaxilofacial, tratamiento de las malformaciones cong&eacute;nitas, adquiridas y del desarrollo de los tejidos blandos y duros de la regi&oacute;n bucomaxilofacial, tratamiento del dolor en regi&oacute;n bucomaxilofacial</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>El rol del cirujano bucomaxilofacial es determinante, por lo tanto su presencia en las &aacute;reas de emergencia en cl&iacute;nicas y hospitales es vital, especialmente si hay sospecha de traumatismo que involucre el &aacute;rea maxilofacial</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>Si usted requiere mayor informaci&oacute;n acerca de esta especialidad, los profesionales miembros de la <a href=\"http://www.svcbmf.net/\">Sociedad Venezolana de Cirug&iacute;a Bucomaxilofacial</a>, cursos de postgrado o cualquier duda relacionada, comun&iacute;quese con nosotros aqu&iacute; y con gusto le responderemos.</p>\n', '966331.jpg', 1, 1, '2018-10-27 04:12:09'),
(2, 'Libro Dr. César Guerrero Barros', 1, 1, '<p>Es un orgullo Venezolano exponer los conocimientos científicos que durante años han sido desarrollados por el Dr César Guerrero y su equipo (Dres. Gisela y Rafael Contasti, Elena Mujica, Mariana Henriquez, Enif Dominguez, Marianela Gonzalez, Wendy Camacho, Helen Rivera y Aura Marina Rodriguez) en la corrección de Deformidades Craneofaciales y Reconstrucción Facial en publicaciones de prestigio Internacional, entre ellos:<br>&nbsp;</p><p><strong>Atlas of Oral and Maxillofacial Surgery.</strong> Kademani / Tiwana. Elsevier 2016, Mandibular and Maxillary Intraoral Distraction Osteogenesis.</p><p><strong>Orthognathic Surgery:</strong> Principles, Planning and Practice .Naini/Gil Wiley-Blackwell 2017 Mandibular and Maxillary Distraction Osteogenesis.</p><p><strong>Craniofacial Distraction J McCarthy.</strong> 2nd Edition. Springer 2017. Intraoral mandibular distraction.</p><p><strong>Oral and Maxillofacial Surgery .Fonseca. </strong>3rd Edition. Elsevier 2017. Intraoral distraction osteogenesis.</p><p><strong>Principles of Oral and Maxillofacial Surgery.</strong> Miloro-Ghali-Larsen-Waite. Elsevier 2018.</p><p>Publicaciones que han contribuido a la formación de profesionales en nuestro país y fuera de sus fronteras, siendo referencia en los siete continentes.</p><p>&nbsp;</p><p>El Dr. César A. Guerrero es Odontólogo graduado de la Universidad Central de Venezuela, continuó su educación en el Hospital de la Cruz Roja de Venezuela por 3 años en el área de Cirugía Maxilofacial del postgrado de Cirugía Plástica y Reconstructiva. Hizo su residencia completa en Cirugía Bucal y Maxilofacial en la Escuela de Medicina de la Universidad del Suroeste, en el Hospital de Parkland Memorial y hospitales asociados de Dallas y Fort Worth, Texas. Fue Director del Centro de Cirugía Maxilofacial Santa Rosa y Profesor colaborador de las Cátedras de Cirugía y Ortodoncia de la UCV. Continuó como profesor de la Universidad de Texas en la Escuela de Medicina de Galveston, como Profesor en Cirugía Bucal y Maxilofacial; actualmente está dedicado a la práctica privada de la especialidad en el Sur de Houston, Texas. Recibió el premio \"como cirujano del año\" del Colegio Americano de Cirugía Bucal y Maxilofacial, con el premio Harry Archer en el 2016, dió la conferencia presidencial Kurt H Thoma, recibió el segundo premio en Innovaciones en Cirugía Bucal y Maxilofacial en el congreso mundial de la Asociación Internacional en Hong Kong, China, en el 2017.</p>', '266488.jpg', 1, 1, '2018-10-27 06:12:09'),
(3, 'Venezuela tiene un nuevo Delegado AOCMF para el periodo 2018-2021', 1, 2, '<p>En el mes de Julio, se abrió la postulación para la elección del nuevo delegado (chair) de la AOCMF para Venezuela, siendo electo posterior al análisis curricular, experiencia docente y finalmente sometido al proceso de votación entre los miembros del país y latinoamérica el Dr. Paul Maurette, Actual presidente de nuestra Sociedad.</p><p>&nbsp;</p><p>La AOCMF (la división clínica craneo maxilofacial de AO Foundation) &nbsp;con más de 60 años de actividades educativas, está conformada por un grupo multidisciplinario de participantes y profesores de diversas especialidades como lo son la Cirugía Buco-Maxilofacial. Otorrinolaringologia, Cirugía de cabeza y cuello, Cirugía Plástica y Reconstructiva. &nbsp;Cada año, AOCMF ofrece alrededor de 110 actividades educativas celebradas en todo el mundo a más de 5.000 apasionados cirujanos.</p><p>&nbsp;</p><p>La misión de AOCMF es la excelencia en el tratamiento de la cirugía facial en sus diversas especialidades. Por ello, desde AOCMF animamos a todos aquellos profesionales interesados en el campo de la cirugía craneo-maxilofacial, cirugía plástica, ENT, cirugía oculoplástica y neurocirugía a que participen y hagan suya esta organización. Para conseguirlo, nos comprometemos a permanecer en la vanguardia de la educación y de los nuevos avances, ofreciendo aprendizaje y experiencias destacables en la red enfocadas en el tratamiento de trauma y reconstrucción craneo-maxilofacial.</p><p>&nbsp;</p><p>Es un orgullo para nuestro gremio que él haya sido electo nuevamente un delegado para Venezuela de nuestra especialidad, Esto refuerza el compromiso y la excelencia desarrollada durante la gestión del Dr. José Gregorio Melillo quien después de 6 años dejo esta gran responsabilidad, la cual llevó de manera impecable y logró grandes avances y el posicionamiento de nuestro país a nivel regional e internacional a pesar de la crisis que atravesamos actualmente. &nbsp; Éxitos al Dr. Maurette en esta nueva responsabilidad el pro de Venezuela.</p><p>&nbsp;</p><p>En el Mes de Septiembre el Dr. César Guerrero Barros, Cirujano Buco-Maxilofacial venezolano Expresidente y Miembro activo de nuestra Sociedad, fue electo miembro de la Junta Directiva de la Asociación Latinoamericana de Cirugía Craneofacial, &nbsp;durante el congreso de esta asociación científica multidisciplinaria congreso en la ciudad de Sao Paulo- Brasil, siendo el presidente electo el Dr. Percy Rossell de Perú y el Dr. Fernando Molina Montalvo de México, Cirujano Plástico y Reconstructivo, como vice-presidente. &nbsp;EL Dr Guerrero es el primer Cirujano Maxilofacial en la Junta Directiva, y tendrá dentro de sus actividades gran responsabilidad de organizar tres eventos en Bogotá, Santo Domingo y Panama, en los próximos 2 años.</p><p>Noticias como las anteriores refuerzan la proyección internacional de nuestra especialidad con el reconocimiento de nuestros miembros como líderes y voceros con proyección internacional dentro de una visión de trabajo en equipos, &nbsp;de reconocimiento de pares y que complementan el estudio, investigación, el desarrollo de proyectos sobre diferentes problemáticas y patológicas con visión de teamwork complementandose las diversas especialidades para el tratamiento de las patologías en el área craneomaxilofacial</p><p>Enhorabuena! Y felicidades a los Dres Guerrero, Melillo y Maurette.</p>', '173931.jpg', 0, 1, '2018-10-27 07:12:09'),
(4, 'Plataforma Virtual Educativa de la Sociedad Venezolana de Cirugía Buco-Maxilofacial', 1, 2, '<p>Con una Visión Innovadora en pro de la Educación.</p><p>Rompiendo Fronteras!</p><p>&nbsp;</p><p>En poco tiempo nuestros miembros, residentes y colegas del área de la salud contarán con un recurso innovador que se encuentra en la fase final de implantación y que conjugara herramientas, recursos educativos, de intercambio clínico y académico, &nbsp;para el fortalecimientos de nuestras especialidades.</p><p>&nbsp;</p><p>Nuestra Sociedad sigue avanzando con visión innovadora, con el fortalecimiento de los valores institucionales, bajo pilares de educación, profesionalismo y ética que consolidan el trabajo de más de 60 años en pro de nuestra Venezuela.</p>', '772049.jpg', 0, 1, '2018-10-27 09:12:09'),
(5, 'Educación continúa 2021', 1, 0, '<p><img alt=\"\" src=\"https://tipscirubucal.com/wp-content/uploads/2021/04/jorn2.jpg\" style=\"height:242px; width:500px\" /></p>\n\n<p>Reg&iacute;strate en el siguiente link:</p>\n\n<p><a href=\"https://www.eventbrite.com/e/jornadas-de-educacion-continua-2021-tickets-150555544687\" target=\"_blank\">https://www.eventbrite.com/e/jornadas-de-educacion-continua-2021-tickets-150555544687</a></p>\n\n<hr />\n<p>Fecha: 14 de abril<br />\nHora: 8:00pm (Hora de Venezuela)</p>\n\n<p><br />\nCon&eacute;ctate en Zoom:<br />\n<a href=\"https://us02web.zoom.us/j/87672680634?pwd=bXJGQ1BIWUJ1Z3dHaHMvMElhMVVIdz09\" target=\"_blank\">https://us02web.zoom.us/j/87672680634?pwd=bXJGQ1BIWUJ1Z3dHaHMvMElhMVVIdz09</a></p>\n\n<p><br />\nID de la reuni&oacute;n: 876 7268 0634<br />\nC&oacute;digo de acceso: 524298</p>\n\n<hr />\n<p><strong>Rinoplastia como procedimiento complementario en la cirug&iacute;a Ortognatica</strong></p>\n\n<p>Dr. Paolo Verona</p>\n\n<p><img alt=\"\" src=\"https://tipscirubucal.com/wp-content/uploads/2021/04/91003820-D2F8-4161-B5E3-27535EF0E69D-1.jpeg\" style=\"height:248px; width:250px\" /></p>\n\n<p>Cirujano Maxilofacial de la universidad militar nueva granada / Hospital militar Central de Bogot&aacute; ,entrenamiento en Cirugia artroscopia de ATM hospital Clinico San Carlos Madrid , fellow en Cirugia estetica facial y rinoplastia Leon, Mexico y Roma Italia , Diplomado en Cirug&iacute;a estetica facial , certificaci&oacute;n board en Cirug&iacute;a oral y maxilofacial por alacibu board en Cirugia estetica facial academia internacional de Cirugia estetica , coordinador de la seccional de cirug&iacute;a est&eacute;tica maxilofacial de alacibu , miembro de la junta directiva de la SVCBMF.</p>\n\n<hr />\n<p><strong>Osteotom&iacute;as Faciales Complementarias a la Cirug&iacute;a Ortogn&aacute;tica</strong></p>\n\n<p>Dr. Sergio Olate</p>\n\n<p><img alt=\"\" src=\"https://tipscirubucal.com/wp-content/uploads/2021/04/Olate12-1.jpeg\" style=\"height:375px; width:250px\" /></p>\n\n<p>Sergio Olate, CD, COMF, MSc, PhD Fellow del European Face Centre Profesor Asociado, Divisi&oacute;n de Cirug&iacute;a Oral, Facial y Maxilofacial, Universidad de La Frontera Sub Director, Centro de Excelencia en Estudios Morfol&oacute;gicos y Quir&uacute;rgicos, Universidad de La Frontera CHILE.</p>\n\n<h3>Moderadores:</h3>\n\n<h3>Dr. Jos&eacute; Luis Castro</h3>\n\n<h3>Dr. Fidel Guzm&aacute;n</h3>\n\n<hr />\n<p>Fecha: 14 de abril</p>\n\n<p>Hora: 8:00pm (Hora de Venezuela)</p>\n\n<p>Con&eacute;ctate en Zoom:&nbsp;<a href=\"https://us02web.zoom.us/j/87672680634?pwd=bXJGQ1BIWUJ1Z3dHaHMvMElhMVVIdz09\">https://us02web.zoom.us/j/87672680634?pwd=bXJGQ1BIWUJ1Z3dHaHMvMElhMVVIdz09</a></p>\n\n<p>ID de la reuni&oacute;n: 876 7268 0634</p>\n\n<p>C&oacute;digo de acceso: 524298</p>\n', 'jorn11.jpg', 1, 1, '2021-04-10 16:46:24'),
(6, 'prueba', 1, 0, '<h2><img alt=\"\" src=\"https://mmedia.eluniversal.com/18726/proceso-de-vacunacion-para-personas-de-tercera-edad-71928.jpg\" style=\"height:406px; width:720px\" /></h2>\n\n<h2><strong>Mant&eacute;ngase &aacute;gil y eficiente en tiempos de transformaci&oacute;n digital</strong></h2>\n\n<p>Realizamos asociaciones estrat&eacute;gicas con proveedores de tecnolog&iacute;a, con soluciones y servicios de clase mundial.</p>\n\n<p>Con nuestras soluciones apoyamos el desarrollo de las capacidades tecnol&oacute;gicas que le permitir&aacute; dar una respuesta r&aacute;pida a las demandas de sus clientes, actualizar eficazmente sus sistemas, desarrollar nuevas aplicaciones con lanzamiento acelerado al mercado y generar mas presupuesto para la innovaci&oacute;n.</p>\n\n<p>Somos especialistas en automatizaci&oacute;n de procesos para clientes con soluciones de tipo ERP de proveedores de tecnolog&iacute;a como SAP, Oracle, Microsoft, etc.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n', 'osteo.jpg', 0, 0, '2021-04-10 21:49:07'),
(7, 'Educación Continua 2021 - Videos', 1, 0, '<p>Procedimientos estéticos asociados a Cirugía Ortognática:</p><figure class=\"media\"><oembed url=\"https://youtu.be/2IHBwBptYrQ\"></oembed></figure><p><a href=\"https://youtu.be/2IHBwBptYrQ\">https://youtu.be/2IHBwBptYrQ</a></p>', 'Screen_Shot_2021-07-30_at_2_13_12_AM.png', 1, 1, '2021-04-17 16:49:15');
