(11, 'Yeannette  de Monges', 'asesoresdetesis@gmail.com', '04265160617', 'Buenas amigos\nLes escribo de la Fundación Odontológica Dr. John Monges para poner a su disposición para postear la publicidad de este prestigioso evento bucomaxilofacial que tienen previsto ustedes para el mes de julio.  Nuestra página del Dr. John Monges que está bajo nuestro cargo y administración dispone de 36.500 usuarios. Todos del área de Odontología. Con todo gusto le ofrecemos un espacio para colaborar con la difusión del curso. Bendiciones. Yeannette Bonacia de Monges. 0426-516-06-17 . Si es de su interés por favor póngase en contacto para que nos indique la información completa. Bendiciones.', '2020-03-13 20:49:46'),
