(13, 'roberto de faria', 'robertocdefariaf@hotmail.com', '04121986685', 'Buenas, les escribo para saber si ustedes por casualidad podrían ayudarme con una cirugía maxilofacial, ya que me están doliendo las muelas, pero no dispongo del dinero para la operación, lo que he ahorrado hasta ahora han sido 15$, lo cierto es que ya no aghuanto el dolor, y no encuentro quien me pueda ayudar, muchas gracias, saludos. ', '2020-05-17 04:48:51'),
