(16, 'Carmen Mendoza', 'natha1275@gmail.com', '04263181429 ', 'Tengo una especie de laceraciones en la lengua desde hace 8 meses aproximadamente, al principio eran muy pequeñas y de color rosado fuerte pero al pasar los meses se me fueron haciendo grietas y se volvieron blancas y aumentaron de tamaño y tengo la lengua un poco inflamada, debido a esto asistí con una Dra. del área maxilofacial y me indicó que debía hacerme una biopsia para un estudio más detallado de lo que observó, me tomo la muestra y me indicó a que doctora debía llevarle la muestra, pero por razones de distancia desde donde yo vivo, a la zona donde tenía que llevar la muestra para analizarla y también debido a la cuarentena y las restricciones no pude entregarle la muestra a la Dra. que ella me indicó y lleve la muestra a otro laboratorio cercano a mi domicilio, cuando recibí el resultado se lo mostré a la Dra., ahora me indica que el resultado del análisis que me dio el laboratorio donde fui no es válido, alega que fui a un patólogo general y no a uno especializado en el área maxilofacial (como el que ella me indicó) y por tal razón no es confiable el resultado, mi pregunta es, realizarme un análisis, como lo es una biopsia en un laboratorio patológico general puede variar el resultado sino fue realizado por un patólogo especializado en el área maxilofacial? La Dra. No quiere indicarme tratamiento por esta razón, lo que me indica es tomarme la muestra nuevamente para que se la lleve a otra Dra. que ella me recomienda, pero esto implica pasar nuevamente por esa molestia, gastar más dinero tanto para adquirir los materiales para hacerme la biopsia como hacer el estudio ya que es a través de un hospital público donde me toman la muestra pero los materiales y el análisis de la biopsia corre por mi cuenta solo donde esta Dra. me lo indica. Siento muchas molestias en la lengua y el área de la garganta. Que me recomiendan? Que puedo hacer? Que me sugieren? Los resultados de mi biopsia fueron los siguientes: \nBIOPSIA DE LESIÓN DE LENGUA\nSe observa: \nAcantosis y Papilmatosis de la Epidermis\nUlceración Superficial extensa con material fibrinoide\nIntenso infiltrado inflamatorio mixto en la unión dermoepidermica.\nNo hay evidencia de malignidad\n\nConclusión diagnostica:\nHallazgos compatibles con quemaduras\n', '2020-07-21 14:12:45'),
(17, 'ricardo trinca', 'ricardo.trinca@tecnologiados.com', '58 412 28.74.622', 'Buenos dias estimados Sres\n\nSomos una empresa de tecnologia Medica, que respresentamos en Venezuela a la marca Carl Zeiss. Estamos interesados en ver las opciones de publicidad que podriamos realizar en su pagina Web, asi como en el patrocinio de Webinars.\n\nagradeceria muchisimo que nos envien la informacion referente a los costos de las opciones de publicidad\n\nSaludos\n\nRicardo Trinca\n\n', '2020-08-11 15:08:32'),
