(30, 'Dr Nakul Uppal', 'drnakul@gmail.com', '9845628027', 'Sir,\n\nSub: Request for Membership of the Association\n\nGreetings from India. I am Dr Nakul Uppal and at present I am Associate Professor in Oral and Maxillofacial Surgery. I operate and teach full-time at the All India Institute of Medical Sciences at Raipur in India, which is a teaching institute owned by the Ministry of Health of the Government of India. \n\nI would like to become a member (preferably a Life Member) of the Association. Would you advise me please on the process to be admitted as a (Life) Member?\n\nRegards,\nDr Nakul Uppal', '2021-03-04 14:44:00'),
