(44, 'Roberto De Faria', 'robertocdefariaf@hotmail.com', '04121986685', 'Buenas, me gustaria saber cual es el precio de la consulta para una cirugía maxilofacial, y que es lo que debo de realizar principalmente.\nMi problema es que tengo las encías muy retraidas, y adicionalmente los dientes canino, primer premolar,  segundo premolar, y primer molar del lado superior izquierdo, los tengo desgastados y a veces me molesta cuando tomo una bebida, o cuando mastico, espero contar con su ayuda para resolver mi situación.\nMuchas gracias de antemano.\n', '2021-07-28 23:31:58'),
