(51, 'Braulio Lopez', 'bhlabs7@gmail.com', '04144169994', 'Buenas noches , gusto en saludarlos , soy cirujano buco-maxilofacial del hospital universitario Dr. Ángel Larralde IVSS - FOUC , quería saber cómo solicitar mi adición al directorio de especialistas de su portal web , gracias de antemano !!', '2022-01-14 00:49:50'),
(52, 'Carlos Briceño', 'drcarlosbricenoa@gmail.com', '04141311251', 'Cordial Saludo.\nNecesito saber cuál es el estado de cuenta para estar solvente ante la sociedad.\nCarlos Rafael Briceño Avellaneda\nCI 18304954\nCirujano Bucal \n\nGracias ', '2022-02-08 03:54:53'),
(53, 'Georgina scott ', 'Georginascottlopez@gmail.com', '04125779414', 'Buenas noches, acabo de realizar el pago del curso de cirugía ortognatica mínimamente invasiva, y no me deja adjuntar el pago!', '2022-02-11 03:02:37'),
(54, 'Carla Cordova', 'carlacordova07@gmail.com', '4145796387', 'Buenas tardes, la presente es para solicitar información y corroborar si aún existe la posibilidad de cancelar el monto de inscripción estudiantil como residente de postgrado de cirugía bucal, en 150$ a través de zelle. Gracias por su receptividad. ', '2022-03-03 18:07:51'),
(55, 'Daniela fariña', 'Danifariasis25@gmail.com', '04123029489', 'Buenas noches, un cordial saludo. Les escribo con preocupación debido a que el dia 17 de febrero del 2022 me inscribi al congreso e hice el pago via transferencia bancara en bolivares y no recibi ningun comprobante de confirmacion de que estoy inscrita en el congreso. Me podrian dar informacion por favor de si estoy inscrita o no. El numero de referencia fue 000025520655934 banco mercantil, a nombre de daniela fariña. Espero pronta respuesta, muchas gracias.', '2022-03-11 00:01:13'),
(56, 'Sabrina Sousa', 'Sabrinasousa99@hotmail.com', '04142670830', 'Buenas tardes. Realice la compra de un ticket para el Congreso a nombre de Gabriel Acevedo pero puse mal el correo. Es gead98@gmail.com . Agradeceria si me pudieran ayudar para obtener la confirmación ', '2022-03-14 18:38:54'),
(57, 'Keila godoy', 'kaygodoy2010@gmail.com', '04122073054', 'Buenas tardes. Quisiera saber cuánto me sale una consulta ya que me gustaría operarme la mandíbula inferior ya que a medida que pasa l tiempo se ve peor ,mi sonrisa es peor ,hasta se me dificulta hablar , estéticamente me hace ver muy mal y quisiera ponerme con algún profesional para llevar a cabo una corrección de la misma lo más pronto posible. Gracias', '2022-03-16 22:14:00'),
(58, 'Wendy Ferrer', 'wendycfmo@gmail.com', '04146458953', 'Quiero inscribirme en el congreso, para pagar por zelle, no encuentro el link... podrian ayudarme, si me envian info al correo formalizo mi inscripcion de inmediato', '2022-03-18 00:22:09'),
(59, 'Rosnalvis Bello ', 'rosnalvis.bello@gmail.com', '04128357421', 'Buen día, estoy interesada en el postgrado de cirugia Buco-Maxilofacial. Me facilitarían toda la información relacionada al postgrado, por favor ', '2022-03-24 18:05:43'),
(60, 'Valentina Arias', 'valentina.arias.r@gmail.com', '+573207062551', 'Buenas tardes, \nMe gustaría saber si esta la opción de asistir al congreso de manera virtual.\nMuchas gracias.\n\n', '2022-03-27 18:49:28'),
(61, 'Fanny Garcia ', 'Fannyjgy@gmail.com', '04249156841', 'Hola necesito un apoyo necesario por el pragmatismo mandíbulas que tengo... si pueden estaré esperando de su respuesta gracias DIOS LOS CONTINUE BENDICIENDO ', '2022-03-28 06:08:34'),
(62, 'Darimig Barazarte Parra ', 'darigbarazarte@gmail.com', '04123916905', 'Hola Estoy interesada en asistir al congreso... Cuáles son los pasos a seguir para lograr asistir?.', '2022-04-01 00:44:04'),
(63, 'Isabel  Illesca Escudero', 'iillesca@hotmail.com', '04166477589 04244394', 'Buenas noches, reciban un cordial saludo. Me gustaría comentar que el directorio profesional era más sencillo y practico (amigable) anteriormente, se buscaba por estados y salían todos los profesionales de ese estado. Ahora es complicado.   \nSi pudieran mejorar o dejarlo como era antes sería bueno. Es mi sugerencia. Atte. Isabel Illesca E.', '2022-04-07 02:06:28'),
(64, 'Alvaro Leon', '93leonczs5@gmail.com', '+593939027208', 'Buenas me llamo Alvaro, soy de Ecuador y me gustaría información para sabe como me inscribo para la carrera de cirugía maxilofacial los documentos que necesito y los requerimientos ', '2022-04-26 14:49:58'),
(65, 'YSAMAR SALAZAR', 'inversioneshermar539@gmail.com', '04163281636', 'Buenas tardes un gusto saludarles.\nAdjunto se encuentra carta de solicitud de Ayuda para Operación Maxilofacial de Ysamar Salazar, quien vive en Orinoco, Municipio Tubores, Estado Nueva Esparta.\nEsperamos de su buena voluntad para ayudar a canalizar dichos recursos.\nEsperemos en Dios de su buen gesto y corazón noble.\n\nYsamar Salazar\nCédula: 12223997\nTeléfono: 04163281636', '2022-05-12 21:30:06'),
(66, 'Lady Lopez ', 'laddyss12@hotmail.com', '0969764586', 'Buenas tardes, por favor deseo informacion para realizar el postgrado en cirugia bucal y maxilofacial. Muchas gracias ', '2022-05-12 22:54:14'),
(67, 'Ninoska Coromoto Noguera Pache', 'ninoskanoguera7@gmail.com', '58 426-5192659', 'Mi hija, fue operada por el Dr. Cesar Guerrero para corregirle un defecto fuerte de la mandíbula superior. Ahora requiere se le retire una muela, por lo que es muy importante lo haga un especialista que sepa de esto, pues no quiero que se pierda la operación o le queden forzadas la mandíbulas.\nPodrían informar si hay algún especialista en sus nominas que pueda hacerme un precio solidario y me ayude con el problema odontológico de mi hija.\nGracias.\nMi hija es persona con discapacidad Psico- motriz pero se vale muy bien sola.', '2022-06-06 17:23:07'),
(68, 'Roscely torres', 'roscelycarolina@hotmail.com', '04249507151', 'Buenas noches , podrían orientarme donde podría cruzar el postgrado de cirugía maxilofacial un odontólogo en caracas ?', '2022-06-14 00:27:21'),
(69, 'Dr. Nicolas Ariel Modragon Tor', 'mr.torrez94@gmail.com', '63411560', 'buenas noches quiero consultar, como puedo acceder a la especialidad de cirugía maxilofacial siendo extranjero, pías Bolivia. a que lugar debo apersonarme en Venezuela cueles son los requisitos, y la fechas de inscripciones. por favor ', '2022-06-16 22:51:42'),
