INSERT INTO `pacientes` (`id`, `title`, `user_id`, `category_id`, `description`, `image`, `is_featured`, `is_active`, `created_at`) VALUES
(1, 'Cirugía de Cordales (Terceros molares o muelas del juicio)', 1, 1, '<p><i>Quizás una de las intervenciones más comunes y, por qué no, rutinarias realizadas de manera ambulatoria de la Cirugía Bucal y Maxilofacial, es la extracción quirúrgica de las cordales o terceros molares...</i></p><p>&nbsp;</p><p>Los terceros molares erupcionan a través de las encías normalmente entre los 17 y 21 años de edad. Sin embargo en una gran cantidad de casos puede ocurrir un retraso en su erupción generalmente ocasionado porque no hay suficiente espacio en los maxilares para dichos molares.</p><p>Esta falta de espacio suele ocasionar que los terceros molares ––coloquialmente conocidos como “muelas del juicio”–– no erupción en del todo y permanezcan impactados en la encía o el hueso, lo cual puede causar complicaciones como dolor e inflamación; el apiñamiento y/o mala oclusión dentaria debido a que éstos ejercen presión sobre los demás dientes en su intento por erupcionar; aparición de quistes abscesos o procesos infecciosos, y en algunos casos desviación en la mordida.</p><p>La Pericoronitis es una infección relacionada con los terceros molares, causada por restos de comida y placa bacteriana en la región de la cordal y la mucosa, la cual puede extenderse a otros espacios bucales. Puede tener como manifestaciones clínicas la presencia de enrojecimiento, inflamación, dolor, mal aliento, sensibilidad en las encías, sabor desagradable, dificultad para abrir la boca, fiebre, dolor de cabeza e incluso de oídos, entre otros.</p><p>Debido a estas afecciones se suele indicar la extracción de las cordales, la cual se realiza mediante un procedimiento quirúrgico bastante sencillo, sin dolor ni ansiedad, y que generalmente demora menos de una hora.</p><p>Antes de pautar la cirugía, es importante que el paciente sea objeto de una correcta evaluación clínica y radiográfica por parte del cirujano tratante durante la primera consulta para poder determinar el plan de tratamiento adecuado para usted.</p><p>Dicha cirugía es realizada sobre anestesia local, gracias a la cual el paciente no siente molestia alguna durante la remoción. En caso de que por alguna razón particular se requiera, también existe la posibilidad de realizar el procedimiento bajo “Sedación Endovenosa”, la cual se efectúa en conjunto con un médico anestesiólogo y bajo monitorización, para el bloqueo total de la ansiedad y miedo durante la cirugía, con el beneficio adicional que brinda al paciente excesivamente ansioso una sensación de bienestar y, además, no recordará la intervención realizada.</p><p>El proceso de recuperación luego de la extracción de las cordales es breve y con mínimas molestias. Es normal una leve inflamación que cederá en poco tiempo. El paciente recibirá indicaciones para ayudarlo a que este período de recuperación sea lo más expedito y confortable posible así como el esquema de medicamentos necesario para su caso.</p>', 'cirugia-cordales.jpeg', 1, 1, '2018-10-27 04:12:09'),
(2, 'Implantes Dentales Oseointegrados', 1, 1, '<p><i>La opción que hoy en día es el protocolo de elección para la rehabilitación en caso de pérdida de piezas dentales son los implantes. Éstos son un recurso altamente recomendable para la restitución...</i></p><p>&nbsp;</p><p>Un procedimiento cada vez más difundido para la rehabilitación en caso de pérdida de piezas dentales son los implantes. Éstos son un recurso altamente recomendable para la restitución de dientes que por cualquier causa ––traumatismos, patologías–– han sido extraídos.</p><p>Los implantes dentales son unos dispositivos ––similares a unos tornillos––&nbsp; realizados 99% de titanio, los cuales se insertan en el hueso maxilar con el fin de sustituir a las raíces de las piezas dentarias perdidas. Esto luego permite reemplazar la pieza natural por una pieza artificial (corona) de mejor funcionalidad e igual o mejor estética que la natural, y que evita la perdida fisiológica de tejido óseo que ocurre con la perdida dentaria.</p><p>El implante se fusiona con el hueso (fase de oseointegración), proporcionando un soporte estable para los dientes artificiales. Las prótesis y los puentes colocados sobre los implantes no se deslizan ni se salen accidentalmente de la boca, lo cual es una ventaja especialmente importante para la masticación y el habla. Esta adaptación ayuda a que las prótesis y los puentes (al igual que las coronas individuales colocadas sobre los implantes) se sientan más naturales que los convencionales.</p><p>Los implantes proporcionan varias ventajas a los pacientes:</p><p>&nbsp;</p><p>Se reduce el movimiento de las dentaduras, brindando un perfecto soporte y estabilidad a las prótesis.</p><p>Son permanentes y de por vida.</p><p>Ofrecen una sensación más cercana a los dientes naturales, que las dentaduras removibles (totales y/o parciales) no logran.</p><p>Proporcionan un resultado exitoso a nivel estético y al hablar, lo cual adicionalmente contribuye a promover la autoestima y seguridad en el paciente.&nbsp;&nbsp;</p><p>Ayudan a conservar el hueso impidiendo la reabsorción que ocurre tras la pérdida temprana de los dientes.</p><p>Se logra por sus diseños una mejor higiene oral.</p><p>No se requiere tocar o tallar otros&nbsp; dientes para la confección de las prótesis.</p><p>Permite una sensación masticatoria similar a la de los dientes naturales.</p><p>En casos en los cuales se pierden todos los dientes, los Implantes con prótesis fijas, incrementan la calidad de vida de los pacientes y evitan el envejecimiento facial secundario.</p><p>La rehabilitación mediante implantes oseointegrados es un procedimiento que se realiza en varias etapas. La primera de ellas es la instalación ––mediante cirugía–– de los implantes en el maxilar. En muchas oportunidades, cuando el caso lo permite, pueden ser restaurados protésicamente en forma inmediata&nbsp; y en otros casos requieren de un periodo de unas 12 semanas aproximadamente para colocar unos pilares intermediarios de segunda fase a través de la encía y luego finalizar con el sistema protésico elegido (coronas, puentes), de forma firme y precisa.</p><p>El tercer y último paso es la instalación del sistema protésico elegido (coronas, puentes), de forma firme y precisa.</p><p>Es muy importante que luego de realizado todo el proceso y finalizado el tratamiento protésico rehabilitador, el paciente debe seguir fielmente las indicaciones del especialista, con particular atención al cepillado, uso de hilo dental, control de placa bacteriana, y visitas periódicas al Cirujano y al Protesista para asegurar el éxito de su tratamiento.</p>', 'implantes-dentales.jpg', 1, 1, '2018-10-27 06:12:09'),
(3, 'Cirugía Ortognática y Apnea Obstructiva del Sueño', 1, 2, '<p>El término Anomalías Dentofaciales refiere a pacientes que presentan deformidades estéticas y/o funcionales como poco mentón o mandíbula prominente, problemas para respirar por la nariz o alteraciones en el “encaje” de los dientes, entre otros,&nbsp; los cuales se relacionan no sólo con problemas en las arcadas dentarias sino que también con exceso o deficiencia en el crecimiento de los maxilares.</p><p>Estas alteraciones provocan defectos en la apariencia facial, que ocasionan dificultades para hablar, masticar, respirar, así como alteraciones estéticas que se traducen en problemas psicosociales. A su vez pueden desencadenar disfunción de la articulación temporomandibular, generando dolores en los músculos faciales, los cuales se irradian hacia la cabeza, el cuello y los oídos.</p><p>La Cirugía Ortognática corrige las anomalías de los maxilares al colocarlos en la posición correcta, en armonía con la oclusión, mejorando dramáticamente la apariencia facial del paciente (que contribuye sobremanera a elevar la autoestima) así como la fonación y la masticación.</p><p>Este tratamiento requiere el concurso de varias especialidades, siendo el Cirujano Bucomaxilofacial y el Ortodoncista determinantes a lo largo de todo el proceso que se realiza en varias etapas.</p><p>El ortodoncista inicia el tratamiento alineando los dientes con el uso de aparatos ortodónticos fijos. Esta fase dura de nueve a 18 meses aproximadamente, dependiendo de cada caso.</p><p>Luego el Cirujano Bucomaxilofacial realiza la cirugía bajo anestesia general, reposicionando los maxilares en la posición correcta. Pasado el período indicado de recuperación postoperatoria, el Ortodoncista procederá a la conclusión del tratamiento para corregir cualquier detalle de alineación dental que se requiera.</p>', 'cirugia-ortonactica.jpeg', 0, 1, '2018-10-27 07:12:09'),
(4, 'prueba', 1, 0, '<p>fdsf</p>', 'jorn1.jpg', 0, 0, '2021-04-10 16:28:49');
