INSERT INTO `timelines` (`id`, `title`, `user_id`, `category_id`, `description`, `image`, `is_featured`, `is_active`, `created_at`, `youtube`, `facebook`) VALUES
(1, '¿Qué hace un cirujano bucomaxilofacial?', 1, 1, '<p>De acuerdo con la <a href=\"http://alacibu.org/\">Asociación Latinoamericana de Cirugía Bucomaxilofacial, Alacibu, </a>la Cirugía Bucomaxilofacial “es aquella especialidad de la odontología que se ocupa de la prevención, diagnóstico y tratamiento de las enfermedades, traumatismos y defectos funcionales o estéticos, congénitos o adquiridos, de los tejidos duros y blandos de la región bucal y maxilofacial, así como de los tejidos y órganos relacionados que la limitan e integran.”</p><p>&nbsp;</p><p>En Venezuela solamente puede utilizar el título de “Cirujano Bucal” o “Cirujano Bucomaxilofacial” aquel Odontólogo que ha culminado a cabalidad un curso de postgrado en Cirugía Bucal de no menos de dos años de duración, o de Cirugía Bucomaxilofacial de no menos de tres años de duración, en una institución universitaria u hospitalaria reconocida por el Ministerio del Poder Popular para la Salud y el Ministerio del Poder Popular para la Educación y validada dicha especialidad por el <a href=\"http://www.elcov.org/\">Colegio de Odontólogos de Venezuela.</a></p><p>&nbsp;</p><p>&nbsp;</p><p>Los campos de actuación, del cual se desprenden áreas de formación académica e investigación científica, incluyen entre otros: anomalías y patologías de las estructuras buco-maxilofaciales, cirugía de labio y paladar hendido; implantes endoóseos, transplantes y reimplantes en la región buco-maxilofacial, injertos y cirugía reconstructiva de los tejidos duros y blandos en la región bucomaxilofacial, distracción osteogénica; cirugía dentoalveolar; tratamiento de trauma de los tejidos duros y blandos de la región maxilofacial; cirugía ortognática, preprotésica y ortopédica facial, cirugía con finalidades ortodónticas y anomalías dentofaciales, biopsias de la región bucomaxilofacial, tratamiento conservador y quirúrgico de los trastornos de la articulación temporomandibular, diagnóstico y tratamiento quirúrgico y no quirúrgico de los quistes, tumores y enfermedades de la región bucomaxilofacial, tratamiento de las malformaciones congénitas, adquiridas y del desarrollo de los tejidos blandos y duros de la región bucomaxilofacial, tratamiento del dolor en región bucomaxilofacial</p><p>&nbsp;</p><p>&nbsp;</p><p>El rol del cirujano bucomaxilofacial es determinante, por lo tanto su presencia en las áreas de emergencia en clínicas y hospitales es vital, especialmente si hay sospecha de traumatismo que involucre el área maxilofacial</p><p>&nbsp;</p><p>&nbsp;</p><p>Si usted requiere mayor información acerca de esta especialidad, los profesionales miembros de la <a href=\"http://www.svcbmf.net/\">Sociedad Venezolana de Cirugía Bucomaxilofacial</a>, cursos de postgrado o cualquier duda relacionada, comuníquese con nosotros aquí y con gusto le responderemos.</p>', '966331.jpg', 1, 1, '2018-10-27 04:12:09', '', ''),
(2, 'Titulo Video Facebook', 1, 1, '<p>este es un video que se carga desde la bd </p>', '266488.jpg', 1, 1, '2018-10-27 06:12:09', '', 'https://www.facebook.com/plugins/video.php?href=https%3A%2F%2Fwww.facebook.com%2Ffacebook%2Fvideos%2F10153231379946729%2F&width=500&show_text=false&appId=1220443371425206&height=280'),
(3, 'Titulo Video Youtube', 1, 2, '<p>Este es un video de youtube que se carga desde la bd\r\n</p>', '173931.jpg', 0, 1, '2018-10-27 07:12:09', 'j1TXbN_nAVY', ''),
(4, 'Plataforma Virtual Educativa de la Sociedad Venezolana de Cirugía Buco-Maxilofacial', 1, 2, '<p>Con una Visión Innovadora en pro de la Educación.</p><p>Rompiendo Fronteras!</p><p>&nbsp;</p><p>En poco tiempo nuestros miembros, residentes y colegas del área de la salud contarán con un recurso innovador que se encuentra en la fase final de implantación y que conjugara herramientas, recursos educativos, de intercambio clínico y académico, &nbsp;para el fortalecimientos de nuestras especialidades.</p><p>&nbsp;</p><p>Nuestra Sociedad sigue avanzando con visión innovadora, con el fortalecimiento de los valores institucionales, bajo pilares de educación, profesionalismo y ética que consolidan el trabajo de más de 60 años en pro de nuestra Venezuela.</p>', '772049.jpg', 0, 1, '2018-10-27 09:12:09', '', '');
